import React, { useState } from 'react';
import { AppBar, Toolbar, Box, Autocomplete, TextField, Tabs, Tab } from '@mui/material';
import MovieIcon from '@mui/icons-material/Movie';

const dummyArray = ["eMemory", "Brahmastra", "Forest Grump"]
const Header = () => {
    const [value, setValue] = useState(0);
    return (
        <div>
            <AppBar sx={{bgcolor}}>
                <Toolbar>
                    <Box width={'20%'}>
                        <MovieIcon />
                    </Box>
                    <Box width={'30%'} margin={'auto'}>
                        <Autocomplete
                            freeSolo
                            options={dummyArray.map((option) => option)}
                            renderInput={(params) => <TextField variant="standard" {...params} label="Search Across Multiple Movies" />}
                        /> 
                    </Box>
                    <Box display={'flex'}>
                        <Tabs textColor='inherit' indicatorColor='secondary' value={value} onChange={(e,val)=>setValue(val)}>
                            <Tab label="Movies" />
                            <Tab label="Admin" />
                            <Tab label="Auth" />
                        </Tabs>
                    </Box>
                </Toolbar>
            </AppBar>;
        </div>
    );
}

export default Header;
